        <h1>test</h1>
        </div>

        <div style = {box}>
        <h1>test</h1>
        </div>

        <div style = {box}>
        </div>

      </div>
    )
  }
}

const containner ={
  display:'flex'
}

const box = {
  backgroundColor :'skyblue',
  display:'flex',
  width:'22%',
  height:'50%'
}

export default QRStatis;
